import React from 'react'
import "./App.css"
import User from './components/User'

const App = () => {
  return (
    <div>
      <p>Hello, World</p>
      <User firstname={'Ilia'} lastname={'Bolotskikh'} age={'30'} />
      <User firstname={'Alexander'} lastname={'Kochnev'} age={'13'} />

    </div>
  )
}

export default App
